import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <footer id="footer">
      <p>&copy; Rowan Morrison 2025</p>
      <li class="circle-container">
									<div id="mode-toggle" href="#">
									<span class="material-symbols-outlined" id="light-icon">
										</span>
								</div>
							</li>
    </footer>
  );
}

export default Footer;
